import React from "react";
import logo from "../../images/logo.svg";
import '../Header/Header.css';
// import { Link } from 'react-router-dom';

function Header() {
  return (
 <header className="header header_authorized">
      <img
          className="header__logo"
          src={logo}
          alt="белая заглавная буква С в светло-зеленом кругу"
        />
        <div className="header__menu">
        <button type="button" aria-label ="регистрация" className="header__button">
              Регистрация
        </button>
        <button type="button" aria-label ="войти" className="header__button">
              Войти
        </button>
        </div>
</header>
  );
}
export default Header;
